// ==UserScript==
// @name         Twitch duplicate keywords finder
// @description  Script plays notification sound when it detects 5 duplicate messages in a chat
// @author       Bladito
// @version      1.0.0
// @homepageURL  https://greasyfork.org/en/users/55159-bladito
// @match        *://www.twitch.tv/*
// @namespace    Bladito/twitch
// @require      http://code.jquery.com/jquery-latest.js
// ==/UserScript==

(function($) {
    'use strict';

    var threshold = 5;
    var counts = {};
    var blacklist = [];
    var snd = new Audio("data:audio/mp3;base64,");
    var startButton = $('<button class="tw-button">Start script</button>');
    setTimeout(function() {
        $('.chat-input__buttons-container .tw-button').before(startButton);
    }, 5000);

    startButton.on('click', function() {
        startButton.text('Running...');
        console.log('Script running...');
        detectAdditionInDOM($('.chat-list__lines').get(0), function(mutations) {
            mutations.forEach(function(mutation) {
                if (mutation.addedNodes) {
                    mutation.addedNodes.forEach(function(node) {
                        if (node && node.className.indexOf('chat-line__message') >= 0) {
                            processMessage($(node).find('[data-a-target="chat-message-text"]').text());
                        }
                    });
                }
            });
        });
    });

    function processMessage(message) {
        console.log('Processing message:', message);

        counts[message] = (counts[message] || 0) + 1;
        if (counts[message] > threshold && blacklist.indexOf(message) < 0) {
            console.log('POSSIBLE KEYWORD:', message);
            snd.play();
            blacklist.push(message);
        }
    }

    function detectAdditionInDOM(node, callback) {
        var MutationObserver = window.MutationObserver || window.WebKitMutationObserver;
        if (node) {
            if (MutationObserver) {
                var obs = new MutationObserver(function(mutations, observer) {
                    if(mutations[0].addedNodes.length) {
                        callback(mutations);
                    }
                });
                obs.observe(node, { childList:true, subtree:true });
            } else if (window.addEventListener) {
                node.addEventListener('DOMNodeInserted', callback, false);
            }
        }
    }

})(jQuery);
